// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar'; // Asegúrate de que el archivo de Navbar esté en la carpeta correcta
import Reservar from './pages/Reservar'; // Página de reservas


function App() {
  return (
    <Router>
      <Navbar /> {/* La barra de navegación se aplica globalmente */}

      <div className="container">
        <Routes>
          {/* Definimos las rutas de la aplicación */}

          <Route path="/reservar" element={<Reservar />} /> {/* Página de reservas */}

        </Routes>
      </div>
    </Router>
  );
}

export default App;
